import styles from './search_header.module.css';
import React from 'react';

const SearchHeader = props => {
  return (
    <header>
      <img src="/images/logo.png" alt="logo" />
      <h1>Youtube</h1>
      <input type="search" placeholder="Search..." />
    </header>
  );
};

export default SearchHeader;
